         hardwareids . batchID  AS  batchID ,  
         hardwareids . serialnumber  AS  serialnumber ,  
         hardwareids . counter  AS  counter ,  
         hardwareids . address  AS  address ,  
         batches . factoryID  AS  factoryID ,  
